<!DOCTYPE html>
<html>
<head>
<meta content='IE=edge,chrome=1' http-equiv='X-UA-Compatible'>
<title>GC3 View Engine Preview</title>
<meta content='Thought Shop Creative Inc.' name='author'>
<link href="assets/preview/projects/gc3.css" media="screen" rel="stylesheet" type="text/css" />
<style>
  /*<![CDATA[*/
    
  /*]]>*/
</style>

</head>
</html>
<!-- GC3 Specific View Engine Template -->
<script type="text/template" id="plan_list_item">
  <span><img src="<%= plan_small %>" ></span>
  <h3><%= name %></h3>
  <p><%= description %>, <%= area %> Sq. Ft.</p>
</script>

<script type="text/template" id="plan_detail_template">
  <span class="return_plans">Return to Plans</span>
  <div class="plan_type">
    <img src="<%= plan_large %>">
    <div class="details">
       <h3>
         <%= description %>
         <br>
         <%= area %> Sq. Ft.
       </h3>
       <p><%= name %></p>
       <h4>See the view from these floors:</h4>
       <ul class="see_view"></ul>
    </div> <!-- /details -->
  </div> <!-- /plan_type -->
</script>

<script type="text/template" id="unit_info_template">
  <h1>Viewing</h1>    
  <div class="show_plan">
    <img src="<%= plan.plan_small_inverted %>" width="75" height="75">
    <span class="unit_number"><%= number %></span>
    <span class="plan_name"><%= plan.name %></span>
    <% if (obj.plan.description) { %>
      <span class="plan_description"><%= plan.description %>,</span>
      <span class="plan_area"><%= plan.area %> sq ft.</span>
      <span class="view">View This Floorplan</span>
    <% } %>
  </div> <!-- /unit -->
</script>

<script type="text/template" id="floor_info_template">
  <% if (obj.has_markers) { %>
  <div class="nearby_toggle">
    Nearby <span id="toggle_markers">On</span>
  </div>
  <% } %>

  <div class="info">
    <h2 class="current_floor"><span><%= number %></span><%= suffix %> Floor</h2>
    <span class="view_disclaimer">This photo taken from <%= view_name %></span>
    <!-- <span class="view">View This Floorplate</span> -->
  </div>
</script>

<script type="text/template" id="marker_info_template">
  <span class="close">Close</span>
  <div>
     <img src="<%= photo %>">
     <h2><%= title %></h2>
     <p class="sub"><%= description %></p>

     <% if (obj.drive_time) { %>
       <span class="drive"><%= drive_time %> minutes</span>
     <% } %>
     <% if (obj.walk_time) { %>
       <span class="walk"><%= walk_time %> minutes</span>
     <% } %>
     <div class="clear"></div>
   </div> <!-- /loc2 -->
</script>
<canvas id='view_engine'></canvas>
<div id='hud'>
<canvas></canvas>
</div>
<div id='header'>
<div id='select_floor' style='background-image: url();'></div>
<div id='select_plan'>
<span class='select_btn'>Select a Plan</span>
<div class='holder'>
<h2>Floorplans</h2>
<div class='browse_toggle'></div>
<div class='content' id='planlist'></div>
<div class='content' id='plandetail'></div>
</div>
<span class='close'>
Close
</span>
</div>
<div id='locations'></div>
</div>
<div id='footer'>
<div class='disclaimer'>
<p>Views are representational only and may vary between floors. Floorplan dimensions, sizes, specifications, and layouts are approximate only and subject to change without notice. This is not an offering for sale. E.&O.E.</p>
</div>
</div>
<div id='unit_info'></div>
<div id='floor_info'></div>
<div id='screen_saver'>
<div id='logo'>
<img alt="Gc3_logo" src="files/gc3_logo.png" />
</div>
<div id='instructions'></div>
</div>
